const myImage = new Image();
//url to avoid missing pic errors
//now img, url string, is part of js file


myImage.src = 'data:image/jpeg;base64,'; 
//#endregion


myImage.addEventListener('load', function(){
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d');
    canvas.width = 800;
    canvas.height = 706;
    
    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);


    let particlesArray = [];
    const numberOfParticles = 5000;



    // will use to create 5000 similiary particle objects
    class Particle{
        // constructor is manadatory for js class
        constructor(){
            // to make them fall from top to bottom, can change
            // to up and down, bottom and up, or circles
            this.x = Math.random() * canvas.width; 
            this.y = 0;
            this.speed = 0;
            // will make particles fall in dark areas fast
            // and in brighter parts much slower
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
        }

     
        update () {
            this.speed = grid[Math.floor(this.y / detail)][Math.floor(this.x / detail)];
            let movement = (2.5 - this.speed) + this.velocity;
            this.y += movement;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
            //console.log(this.x += movement)
        }
        draw(){
            ctx.beginPath();
            ctx.fillStyle = 'white';
            // to create circle
            ctx.arc(this.x, this.y, this.size, 0, Math.Pi * 2);
            ctx.fill();
            
           
        }

    }
    
    function init(){
        for(let i = 0; i < numberOfParticles; i++){
            particlesArray.push(new Particle());
            
        }
    }

    init();

    // main animation function
    function animate(){
        //set black trans parrent rect over canvas for fading trails
        // transparency 0 to 1
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0,0,canvas.width, canvas.height);
        
        
        // will draw the 5000 particles
        for(let i=0; i< particlesArray.length; i++){
            //particlesArray[i].update();
            
            particlesArray[i].draw();
        }
        
        requestAnimationFrame(animate);
    }
    
    animate();

});

